import React, { Component } from 'react';

export class User extends Component {
  render() {
    return <div>
        <ul>
            <li>Name:</li>
            <li>SurName:</li>
            <li>Age:</li>
            <li>Depart:</li>
        </ul>
    </div>;
  }
}

export default User;
